import React from 'react';
import "./profile.css"

export default function Profile(props) {
  return (
    <>
   
      <img src="/myimage.jpg" alt="Sadhiesh Instagram"  />
      <div className="profile">
      <h1>{props.name}</h1>
      </div>
    </>
  );
}
